import React from 'react';
import { useParams } from "react-router-dom";

const ProductDetails = () => {
    const { productid } = useParams();

    return (
        <div>
            {productid === '0' ? (
                <img url='https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcTijnBbTooCc3j3l0hzllcOFXEgGYPy4yYGRHlY1DBvwQa3Y9pT'></img>
            ) : (
                <h1>Other Product</h1>
            )}
        </div>
    );
}

export default ProductDetails;
